import React, { useState, useEffect } from 'react';
import { Typography, Box, Grid, makeStyles, TableContainer, Table, TableHead, TableRow, TableCell, TableBody, } from "@material-ui/core";
import axios from 'axios';
const useClasses = makeStyles({
    header: {
        background: 'linear-gradient(45deg,#FE6B8B 30% , #FF8E53 90%)',
        color: 'white',
        padding: 5,
        textTransform: 'uppercase'
    }
})

const View = () => {
    const [student, setStudent] = useState({});
    useEffect(() => {
        const getData = async () => {
            const studentdata = await axios('http://localhost:3000/students/1');
            console.log(await studentdata.data);
        }
        getData();
    })

    const classes = useClasses();
    return (
        <>
            <Box>
                <Typography
                    variant='h4'
                    align='center'
                    className={classes.header}
                > Student Details </Typography>
            </Box>

            <Grid item md={12} >
                <Box>
                    <Box >

                        <TableContainer>
                            <Table>
                                <TableHead>
                                    <TableRow>
                                        <TableCell>NO.</TableCell>
                                        <TableCell >Firstname</TableCell>
                                        <TableCell >Lastname</TableCell>
                                        <TableCell >Email</TableCell>
                                    </TableRow>
                                </TableHead>
                                <TableBody>
                                    <TableRow>
                                        <TableCell>id</TableCell>
                                        <TableCell>firstname</TableCell>
                                        <TableCell>lastname</TableCell>
                                        <TableCell>email</TableCell>
                                    </TableRow>

                                </TableBody>
                            </Table>
                        </TableContainer>
                    </Box>
                </Box>
            </Grid>
        </>
    );
};

export default View;
